INSERT INTO `wp_postmeta` VALUES('1586', '5756', '_et_pb_old_content', '<p><span style=\"font-weight: 400;\">The <a href=\"http://www.bayareabeatsdjs.com\">Bay Area Wedding Venues</a> offers excellent venues for you to host your wedding. ¬†The prices vary from mid-range to high end. Fancy schmany indoors, to beautiful outdoor locations. ¬†When booking your location, be sure to ask for various price options: half day, full day, etc. If booking outdoor locations, consider that it would rain & spoil your special day so ask if they have a big tent for these rainy day options! ¬†</span></p><h3><span style=\"font-weight: 400;\">Here is our list of our favorite <a href=\"http://www.bayareabeatsdjs.com\">Bay Area Wedding Venues</a> to host a wedding or other special event.</span></h3><p>¬†</p><p><a href=\"http://sf.cityvoter.com/kunde-family-estate/biz/501921\"><span style=\"font-weight: 400;\">Kunde Family Estate</span></a><span style=\"font-weight: 400;\">: ¬†Breathtaking views overlooking the Valley of the Moon, pure loveliness of California nature at its best! ¬†This 5th generation 1,850 acre family estate is in the beautiful wine country of Sonoma. Your guests will never forget this place! ¬†</span></p><ul><li><span style=\"font-weight: 400;\"> ¬†¬†¬†¬†</span> <span style=\"font-weight: 400;\"> Phone: ¬†(707) 833-5501 </span></li><li><span style=\"font-weight: 400;\"> ¬†¬†¬†¬†</span> <span style=\"font-weight: 400;\"> Web: ¬†¬†www.kunde.com</span></li></ul><p>¬†</p><p><span style=\"font-weight: 400;\">Cinnabar Hills Golf Club: ¬†Spectacular location with stellar views! ¬†Great food & dining services with many first rate choices. ¬†250 person maximum capacity for events with a dancefloor. </span></p><ul><li><span style=\"font-weight: 400;\">Phone: ¬†(408) 323-7814</span></li><li><span style=\"font-weight: 400;\">Web: </span><span style=\"font-weight: 400;\">¬†¬†www.cinnabarhills.com</span></li></ul><p>¬†</p><p><span style=\"font-weight: 400;\">The Julia Morgan Ballroom: ¬†For more than a century this iconic venue has hosted major events such as presidential visits, celebrity parties & famous weddings. ¬†Gourmet cuisine, & the ability to fully tailor to your unique vision make this place special. Its one of the most historical venues in San Francisco & you could not go wrong to tie your knots here! ¬†</span></p><ul><li><span style=\"font-weight: 400;\">Phone: ¬†</span><span style=\"font-weight: 400;\">¬†415-966-0367</span></li><li><span style=\"font-weight: 400;\">Web: ¬†¬†</span><a href=\"http://www.juliamorganballroom.com\"><span style=\"font-weight: 400;\">www.JuliaMorganBallroom.com</span></a><span style=\"font-weight: 400;\"> ¬†</span></li></ul><p>¬†</p><p><a href=\"http://sf.cityvoter.com/ruby-hill-golf-club/biz/693686\"><span style=\"font-weight: 400;\">Ruby Hill Golf Club</span></a><span style=\"font-weight: 400;\">: ¬†An unrivaled setting in Nature nestled in a gated community in paradise. ¬†¬†Breathtaking indoor & outdoor venues. Excellent gourmet food options for catering. ¬†</span></p><ul><li><span style=\"font-weight: 400;\">Phone: ¬†</span><span style=\"font-weight: 400;\">925-417-5840</span></li><li><span style=\"font-weight: 400;\">Web: ¬†¬†</span><a href=\"http://www.rubyhill.com/special-events/weddings\"><span style=\"font-weight: 400;\">www.rubyhill.com/special-events/weddings</span></a></li></ul><p>¬†</p><p><a href=\"http://sf.cityvoter.com/casa-real-at-ruby-hill-winery/biz/109179\"><span style=\"font-weight: 400;\">Casa Real at Ruby Hill Winery</span></a><span style=\"font-weight: 400;\">: ¬†Surrounded by lush green vineyards and olive trees, this 20,000 sq. ft. palace evokes Old-World luxury. Featuring a dramatic entry hall, rustic ceremony room, grand salon, and verdant walled courtyard with fragrant citrus trees and graceful water features, Casa Real is ideal for any celebration, especially weddings! ¬†</span></p><ul><li><span style=\"font-weight: 400;\">Phone: ¬†</span><span style=\"font-weight: 400;\">(925) 931-0200</span></li><li><span style=\"font-weight: 400;\">Web: ¬†</span><a href=\"http://www.casarealevents.com/celebrate/\"><span style=\"font-weight: 400;\">www.casarealevents.com/celebrate/</span></a></li></ul><p>¬†</p><p><a href=\"http://sf.cityvoter.com/the-bently-reserve/biz/112519\"><span style=\"font-weight: 400;\">The Bently Reserve</span></a><span style=\"font-weight: 400;\">: ¬†Built during the Roaring 20s with this vintage decor & aesthetic make this place something your guests will remember! ¬†One of the most majestic venues on the West Coast, the Bently Reserve is an unforgettable location for your wedding day. ¬†</span></p><ul><li><span style=\"font-weight: 400;\">Phone: ¬†</span><span style=\"font-weight: 400;\">415-294-2226</span></li><li><span style=\"font-weight: 400;\">Web: ¬†</span><a href=\"http://www.bentlyreserve.com/weddings\"><span style=\"font-weight: 400;\">www.bentlyreserve.com/weddings</span></a></li></ul><p>¬†</p><p><a href=\"http://sf.cityvoter.com/the-fairmont-san-francisco-hotel/biz/598419\"><span style=\"font-weight: 400;\">The Fairmont San Francisco Hotel</span></a><span style=\"font-weight: 400;\">: ¬†</span><span style=\"font-weight: 400;\">¬†</span><span style=\"font-weight: 400;\">Another historic San Francisco venue where In the famed Venetian Room, Tony Bennett first sang, \'I Left my Heart in San Francisco.\' ¬†And in 1945, delegates from 40 countries around the World met in the historic Garden Room to draft the Charter for the United Nations. ¬†Fairmont San Francisco has been host to the most remarkable events in San Francisco history. Your wedding reception or social occasion may soon be among them.</span></p><ul><li><span style=\"font-weight: 400;\">Phone: </span><span style=\"font-weight: 400;\">1-866-540-4491 </span></li><li><span style=\"font-weight: 400;\">Web: ¬†</span><a href=\"http://www.fairmont.com/san-francisco/meetings-weddings/\"><span style=\"font-weight: 400;\">www.fairmont.com/san-francisco/meetings-weddings/</span></a></li></ul><p>¬†</p><p><a href=\"http://sf.cityvoter.com/the-ritz-carlton-half-moon-bay/biz/596231\"><span style=\"font-weight: 400;\">The Ritz-Carlton Half Moon Bay</span></a><span style=\"font-weight: 400;\">: ¬†</span><span style=\"font-weight: 400;\">California Dreamin‚Äô for a perfect dreamy wedding venue? ¬†Look no further! Just 30 miles (1 hour drive) from San Francisco, nestled along the beautiful oceanside of Half </span><span style=\"font-weight: 400;\">Moon Bay. ¬†This is an exceptional location for weddings with two beautiful outdoor event spaces to choose from. ¬†The indoors are just as impressive with the grand ballroom‚Äôs chandeliers & vaulted ceilings. </span></p><ul><li><span style=\"font-weight: 400;\">Phone: ¬†</span><span style=\"font-weight: 400;\">1 (650) 712-7000</span><span style=\"font-weight: 400;\"><br /> </span> <span style=\"font-weight: 400;\">Web: www.ritzcarlton.com/en/hotels/california/half-moon-bay</span></li></ul><p>¬†</p><p><a href=\"http://sf.cityvoter.com/the-winery-sf/biz/643140\"><span style=\"font-weight: 400;\">The Winery SF</span></a><span style=\"font-weight: 400;\">: ¬†</span><span style=\"font-weight: 400;\">This great venue is offering weddings for up to 225 people with Reception and Ceremony along the San Francisco Bay waterfront. ¬†Voted \"Top 5 Wedding Venues\" in the Bay Area by many surveys. </span></p><ul><li><span style=\"font-weight: 400;\">Phone: </span><span style=\"font-weight: 400;\">415-735-8423</span></li><li><span style=\"font-weight: 400;\">Web: ¬†¬†</span><a href=\"http://www.winery-sf.com/weddings/\"><span style=\"font-weight: 400;\">www.winery-sf.com/weddings/</span></a></li></ul><p>¬†</p><p><a href=\"http://sf.cityvoter.com/montalvo-arts-center/biz/703477\"><span style=\"font-weight: 400;\">Montalvo Arts Center</span></a><span style=\"font-weight: 400;\">: ¬†One of the </span><span style=\"font-weight: 400;\">favorite wedding venues of the Bay Area for many years. ¬†At Montalvo, you have use of the grounds, Great Lawn, Villa, Spanish Courtyard and Oval Garden or Love Temple for your dream wedding and reception. ¬†</span></p><ul><li><span style=\"font-weight: 400;\">Phone: ¬†</span><span style=\"font-weight: 400;\">408-961-5856</span></li><li><span style=\"font-weight: 400;\">Web: ¬†</span><a href=\"http://www.montalvoarts.org/rentals/weddings\"><span style=\"font-weight: 400;\">www.montalvoarts.org/rentals/weddings</span></a></li></ul><p>¬†</p>');
